import React, { useState } from 'react';
import api from '../api';

const CadastroFan = () => {
  const [fan, setFan] = useState({
    nome: '',
    email: '',
    cpf: '',
    interesses: '',
    endereco: ''
  });

  const handleChange = (e) => {
    setFan({ ...fan, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const response = await api.post('/', fan);
    alert("Fã cadastrado com sucesso: ID " + response.data.id);
  };

  return (
    <div>
      <h2>Cadastro de Fã</h2>
      <form onSubmit={handleSubmit}>
        <input name="nome" placeholder="Nome" onChange={handleChange} required />
        <input name="email" placeholder="Email" onChange={handleChange} required />
        <input name="cpf" placeholder="CPF" onChange={handleChange} required />
        <input name="interesses" placeholder="Interesses" onChange={handleChange} required />
        <input name="endereco" placeholder="Endereço" onChange={handleChange} required />
        <button type="submit">Cadastrar</button>
      </form>
    </div>
  );
};

export default CadastroFan;
